import React from 'react';

export default class LeaderBoard extends React.Component {
  constructor() {
    // Add your constructor logic here
    super();
    this.state = {
      leaderboard: []
    };
    // fetch data from the /leaderboard
    fetch('/leaderboard')
      .then(response => response.json())
      .then(data => {
        console.log('Leaderboard data:', data);
        this.setState({
          leaderboard: data
        });
      })
      .catch(error => {
        console.error('Error fetching leaderboard:', error);
      });
  }

  // Add your methods here
  render() {
    return (
      <div>
        {this.state.leaderboard.map((entry, index) => {
          return (
            <div key={index}>
              <span style={{width:'100px'}} >{entry.email}</span>
              <span style={{width:'100px'}}>{entry.timestamp}</span>
              <span style={{width:'100px'}}>{entry.accurancy}</span>
            </div>
          );
        }
        )}
      </div>
    );
  }
}
